import React from "react"
import DisplayPic from "./displayPic"
import cplus from "../pictures/c++_logo.png"
import csharp from "../pictures/c#_logo.png"
import css from "../pictures/css-logo.png"
import es6 from "../pictures/es6-logo.png"
import git from "../pictures/git_logo.png"
import html from "../pictures/html5_logo.png"
import node from "../pictures/nodejs.png"
import postgres from "../pictures/postgres_logo.jpg"
import react from "../pictures/react_logo.png"
import redux from "../pictures/redux_logo.png"
import unity from "../pictures/unity2.png"
const height = "100px"
const width = "100px"


const Skills = () => {
    return (
        <div>
            <br/>
            <br/>
            <DisplayPic
                source={react}
                width={width}
                height={height}
                name = "React"
            />
            <DisplayPic
                source={node}
                width={width}
                height={height}
                name = "Node JS"
            />
            <DisplayPic
                source={css}
                width={width}
                height={height}
                name = "CSS"
            />
            <DisplayPic
                source={es6}
                width={width}
                height={height}
                name = "ES6"
            />
            <DisplayPic
                source={git}
                width={width}
                height={height}
                name = "Git"
            />
            <DisplayPic
                source={html}
                width={width}
                height={height}
                name = "HTML 5"
            />
            <DisplayPic
                source={postgres}
                width={width}
                height={height}
                name = "Postgres"
            />
            <DisplayPic
                source={redux}
                width={width}
                height={height}
                name = "Redux"
            />
            <DisplayPic
                source={unity}
                width={width}
                height={height}
                name = "Unity"
            />
            <DisplayPic
                source={cplus}
                width={width}
                height={height}
                name = "C++"
            />
            <DisplayPic
                source={csharp}
                width={width}
                height={height}
                name = "C#"
            />
        </div>
    )
}

export default Skills
